const { Component } = require('react');

export class App extends Component {
  state = {
    contacts: [],
    name: '',
  };

  render() {
    return (
      <div
        style={{
          height: '100vh',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          fontSize: 40,
          color: '#010101',
        }}
      >
        <div>
          <h1 class="phonebookTitle"></h1>
          <form action="" class="phonebook">
            <label for="">
              <input type="text" class="username" />
              <button class="addContact"></button>
            </label>
          </form>
        </div>
        <div>
          <h1 class="contactTitle"></h1>
          <ul class="contactList">
            <li class="contactItem"></li>
          </ul>
        </div>
      </div>
    );
  }
}
